const GreetingBubble = () => {
    return (
        <div style={{padding:5, display:'flex', flexDirection:'column', width:200,marginLeft:35,marginTop:8,fontSize:13,backgroundColor:'#ed2f65', borderRadius:10, color:'#FFF'}}>
             <div style={{textAlign:'center'}}>
               <p>Welcome to ChatCord</p>
             </div>
        </div>
    )
}

export default GreetingBubble;
